import { Table, Form, Col, Button, Row } from 'react-bootstrap';


function EditProduct() {

  return (
    <DashboardLayout>
      <DashboardNavbar />

      <SuiTypography variant="h1" fontWeight="medium" style={{ color: "green", textAlign: 'center' }}>
      CAMs Raw (Transaction Details)-3590 
      </SuiTypography>
      <Row className="mb-3">
      <Form.Group as={Col} controlId="formGridCity">
          <Form.Label>Folio No/Investor Name/PAN No</Form.Label>
          <Form.Control />
        </Form.Group>

        <Form.Group className="mb-3" as={Col} id="formGridCheckbox">
        <Form.Check type="checkbox" label="Excel" />
      </Form.Group>

        <Form.Group as={Col} controlId="formGridZip">
          <Button variant="primary" type="submit" style={{ margin: '30px', width: '150px' }}>
            Submit
          </Button>
